/*Table structure for table `xd_euser` */

DROP TABLE IF EXISTS `xd_euser`;

CREATE TABLE `xd_euser` (
  `ID` varchar(32) NOT NULL,
  `EUSER_NAME` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `GENDER` int(22) DEFAULT NULL,
  `CELLPHONE` varchar(16) DEFAULT NULL,
  `PASSWORD` varchar(128) DEFAULT NULL,
  `HEAD_IMG` mediumblob,
  `REGISTER_TIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `EMAIL` varchar(128) DEFAULT NULL,
  `STATUS` int(22) DEFAULT '1',
  `BUY_NUM` int(22) DEFAULT '0',
  `TOTAL_PRICE` int(22) unsigned DEFAULT '0',
  `cmbProvince` varchar(10) DEFAULT NULL,
  `cmbCity` varchar(10) DEFAULT NULL,
  `cmbArea` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

