/*Table structure for table `xd_order` */

DROP TABLE IF EXISTS `xd_order`;

CREATE TABLE `xd_order` (
  `ORDER_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `EUSER_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `PRODUCT_ID` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `TOTAL_PRICE` int(22) DEFAULT '0',
  `STATUS` int(22) DEFAULT '0',
  `CREATE_TIME` date DEFAULT NULL,
  `PAY_TYPE` int(22) DEFAULT '0',
  `CONTENT` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`ORDER_NO`),
  KEY `s1` (`EUSER_ID`),
  KEY `s2` (`PRODUCT_ID`),
  CONSTRAINT `s1` FOREIGN KEY (`EUSER_ID`) REFERENCES `xd_euser` (`ID`)
