/*Table structure for table `xd_provider_product` */

DROP TABLE IF EXISTS `xd_provider_product`;

CREATE TABLE `xd_provider_product` (
  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `PROVIDER_ID` varchar(32) DEFAULT NULL,
  `PRODUCT_NAME` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `PRODUCT_IMG` mediumblob,
  `PRODUCT_CONTENT` varchar(4000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `PRICE` int(22) DEFAULT NULL,
  `STATUS` int(22) DEFAULT NULL,
  `RECOMMEND` int(22) DEFAULT NULL,
  `HIGH_QUALITY` int(22) DEFAULT NULL,
  `CREATE_TIME` date DEFAULT NULL,
  `SALE_NUM` int(22) DEFAULT NULL,
  `PROVIDER_NAME` varchar(16) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `p1` (`PROVIDER_ID`),
  KEY `p2` (`PROVIDER_NAME`),
  CONSTRAINT `p1` FOREIGN KEY (`PROVIDER_ID`) REFERENCES `service` (`ID`)
