/*Table structure for table `xd_shopping` */

DROP TABLE IF EXISTS `xd_shopping`;

CREATE TABLE `xd_shopping` (
  `id` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '服务产品',
  `count` int(10) DEFAULT NULL COMMENT '数量',
  `pro_id` int(10) DEFAULT NULL,
  `buy_id` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `forkey1` (`count`),
  KEY `foreignkey1` (`pro_id`),
  KEY `foreignkey2` (`buy_id`),
  CONSTRAINT `foreignkey1` FOREIGN KEY (`pro_id`) REFERENCES `xd_product` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `foreignkey2` FOREIGN KEY (`buy_id`) REFERENCES `xd_bought_user` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `xd_shopping` */

insert  into `xd_shopping`(`id`,`count`,`pro_id`,`buy_id`) values ('16',2,2,NULL),('17',2,8,NULL),('18',2,3,NULL);

/*Table structure for table `xd_store` */

DROP TABLE IF EXISTS `xd_store`;

CREATE TABLE `xd_store` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `store_info` varchar(10) DEFAULT NULL COMMENT '店铺简介',
  `work_time` varchar(10) DEFAULT NULL COMMENT '工作时间',
  `qq` varchar(10) DEFAULT NULL COMMENT 'qq',
  `cellphone` varchar(11) DEFAULT NULL COMMENT '手机号',
  `license` blob COMMENT '营业执照',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=utf8;

